var $bm_rt;
var amp, freq, speed, points, startX, startY, endX, endY, ampStartX, wavePath, i, t, x, yBase, ampFactor, yOffset;
amp = 120;
freq = 4;
speed = thisComp.layer('Einstellungsebene 1').effect('Einstellungen für Schieberegler')('Schieberegler');
points = 150;
startX = -2100;
startY = $bm_sum(500, $bm_mul(Math.sin($bm_mul(time, speed)), 20));
endX = 800;
endY = 500;
ampStartX = -1900;
wavePath = [];
for (i = 0; i <= points; i++) {
    t = $bm_div(i, points);
    x = $bm_sum(startX, $bm_mul(t, $bm_sub(endX, startX)));
    yBase = $bm_sum($bm_mul(startY, $bm_sub(1, t)), $bm_mul(endY, t));
    ampFactor = Math.min(1, $bm_div($bm_sub(x, startX), $bm_sub(ampStartX, startX)));
    yOffset = $bm_mul($bm_mul(Math.sin($bm_sum($bm_mul($bm_mul($bm_mul(t, freq), Math.PI), 2), $bm_mul(time, speed))), amp), ampFactor);
    wavePath.push([
        x,
        $bm_sum(yBase, yOffset)
    ]);
}
$bm_rt = createPath(wavePath, [], [], false);

